import React from "react";
import "font-awesome/css/font-awesome.css";
class UserList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      bookIssues: [],
      error: ""
    };
  }

  render() {
    return (
      <div>
        <h1>Welcome to the Library Management System</h1>
      </div>
    );
  }
}
export default UserList;
